    false,nt"url": null,nt"notes": "This narrative report for Bombay Hook NWR
    outlines Refuge accomplishments from January through April of 1953. The report begins
    by summarizing the weather conditions, water conditions, and food and cover during
    this period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, predators, rodents, mammals, and raptors- is also covered. The Refuge
    development and maintenance section discusses physical developments, plantings,
    and prescribed burning. Resource management is outlined; topics include fur harvesting.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, and violations. Items of interest, N-R forms, and photographs
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
